import React from 'react';


const VideoItem = ({ video }) => {

return (
    <div className="item">
        <img classname="ui image" alt="" src={video.snippet.thumbnails.medium.url} />
            <div className="content">
            <div>{video.snippet.title}</div>
            </div>
        </div>
);

};

export default VideoItem;
